import React from 'react';

function MakePayment() {
  return (
    <div>
      <h2>Make Payment</h2>
      <ul>
        <li>Choose Payment Mode</li>
        <li>Confirm Payment</li>
      </ul>
    </div>
  );
}

export default MakePayment;
